    Teacher[] teacher;
    int kodteacher;
    string firstname;
    string secondname;
    string thirdname;
    string degree;
    string position;
    string experience;

    private enum MODE { None, Add, EditDelete };
    MODE mode = MODE.None;
    Teacher teachers;


    protected override async Task OnInitializedAsync()
    {

        await load();
    }
    protected async Task load()
    {
        teacher = await teacherService.GetTeacherAsync();
    }
    protected async Task Insert()
    {
        Teacher t = new Teacher()
        {
            KodTeacher = kodteacher,
            FirstName = firstname,
            SecondName = secondname,
            ThirdName = thirdname,
            Degree = degree,
            Position = position,
            Experience = experience

        };
        await teacherService.InsertTeacherAsync(t);
        ClearFields();
        await load();
    }
    protected void ClearFields()
    {
        firstname = string.Empty;
        secondname = string.Empty;
        thirdname = string.Empty;
        degree = string.Empty;
        position = string.Empty;
        experience = string.Empty;
    }

    protected void Add()
    {
        ClearFields();
        mode = MODE.Add;
    }
    protected async Task Update()
    {

        Teacher t = new Teacher()
        {

            KodTeacher = kodteacher,
            FirstName = firstname,
            SecondName = secondname,
            ThirdName = thirdname,
            Degree = degree,
            Position = position,
            Experience = experience
        };

        await teacherService.UpdateTeacherAsync(kodteacher.ToString(), t);
        ClearFields();
        await load();
        mode = MODE.None;
    }

    protected async Task Delete()
    {
        await teacherService.DeleteTeacherAsync(kodteacher.ToString());
        ClearFields();
        await load();
        mode = MODE.None;
    }
    protected async Task Show(string id)
    {
        teachers = await teacherService.GetTeacherByIdAsync(id);
        kodteacher = teachers.KodTeacher;
        firstname = teachers.FirstName;
        secondname = teachers.SecondName;
        thirdname = teachers.ThirdName;
        degree = teachers.Degree;
        position = teachers.Position;
        experience = teachers.Experience;
        mode = MODE.EditDelete;
    }


